import { useState } from "react";

function MyButton() {
  function handleClick() {
    alert("You clicked my button :)");
  }

  return (
    <button onClick={(handleClick)}>
      I'm a button
    </button>
  );
}

export default function MyApp() {
  return (
    <div>
      <h1>Welcome to my first App in React</h1>
      <MyButton/>
    </div>
  );
}
